import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Briefly AI</h1>
        <p1>Effortlessly Summaries</p1>
        <button class="button" id="myButton">Upload File</button>
      </header>
    </div>
  );
}

export default App;
